import React from 'react';
import Head from "next/head";
import Navbar from '../src/Navbar/Navbar';

const index = () =>{
    return (
    <div>
        <Head>
            <meta charSet="UTF-8"/>
            <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
            <title>Document</title>
        </Head>
        <Navbar/>
    </div>
)};

export default index;
